INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "お！\nあそこに困ってそうな人発見！", 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 1, 1, 0, "春咲 ひより", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1001);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "大切な人を\n守れるようになりたい…って", 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 1, 1, 0, "草野 優衣", 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1002);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "キミに必要な集中力と感性が", 2, "少しは磨かれると思いますよ。", 0, 1, 1, 1, 0, "士条 怜", 0, "フェンシングを始めてみては？", 0, 0, 1003);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "今日はなにして遊ぶ？", 2, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 1, 1, 0, "穂高 みそぎ", 0, "ねぇ、にいちゃん！", 0, 0, 1004);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "ねぇ…", 2, "私といっしょに…\nいかない？", 0, 1, 1, 1, 0, "風宮 あかり", 0, "風宮あかりです", 0, 0, 1006);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "プリンたべたいのー", 2, "食べ物の恨みは怖いのー", 0, 1, 1, 1, 0, "出雲 宮子", 0, "出雲宮子なのー", 0, 0, 1007);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, "いいよ。\n見られることは運命さ…", 0, 1, 1, 1, 0, "虹村 雪", 0, "ボクは虹村雪。", 0, 0, 1008);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, "人呼んで「疾風の冥姫」!!", 0, 1, 1, 1, 0, "柊杏奈", 0, "フッ…聞いて後悔するがいい！", 0, 0, 1009);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, "ほんまおおきにやわ～♪", 0, 1, 1, 1, 0, "姫宮 真歩", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1010);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 2, "ここで会ったが\n100年目～！", 0, 1, 1, 1, 0, "衣之咲 璃乃", 0, "衣之咲璃乃です！", 0, 0, 1011);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "ち、超能力って…\n何のことかな～？", 2, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 1, 1, 0, "柏崎 初音", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1012);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "一応カリスマ読モJKやってまっす！", 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 1, 1, 0, "美波 鈴奈", 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1016);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "東京は遊園地みたいなところさー", 2, "でも、沖縄もとってもいいとこさー", 0, 1, 1, 1, 0, "喜屋武 香織", 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 1017);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "先生って呼ばれるのは\nくすぐったいから", 2, "イオちゃんって呼んでね。", 0, 1, 1, 1, 0, "支倉 伊緒", 0, "支倉伊緒です。", 0, 0, 1018);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 2, "ミミをおいてかないでぇ～", 0, 1, 1, 1, 0, "茜 ミミ", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1020);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "あの……\nふぇ……", 2, "ふぇぇぇぇぇん……", 0, 1, 1, 1, 0, "栗林 くるみ", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1021);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "こんな私に貴重な時間を\n割いていただき、", 2, "なんてありがとうございます！", 0, 1, 1, 1, 0, "風宮 より", 0, "風宮よりです。\nあああああ！", 0, 0, 1022);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "おにいちゃんどこいくの？\nえ？", 2, "私こっち行きたいー\nね、早く早くー", 0, 1, 1, 1, 0, "北条 綾音", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1023);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 2, "これて何か違う…\nあああすみません！", 0, 1, 1, 1, 0, "天野 すずめ", 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1025);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "あなたは…運命の……\n伴侶……", 2, "離しませんわ………\n絶対に…!!", 0, 1, 1, 1, 0, "倉石 恵理子", 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 1027);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, "…そうでしょ？？", 0, 1, 1, 1, 0, "佐々木 咲恋", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1028);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "ぇっと…\nキミ、私のこと知らないの?!", 2, "あはは、\n私もまだまだだなぁ～", 0, 1, 1, 1, 0, "桜井 望", 0, "桜井望だよ！\nよろしくねっ", 0, 0, 1029);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 2, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 1, 1, 0, "ニノン・ジュベール", 0, "デケデケデンっ！", 0, 0, 1030);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "でもって私の隣にいるのが……\nえ、見えない？", 2, "おかしいですね……", 0, 1, 1, 1, 0, "上喜 しのぶ", 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1031);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "けんども\nそれには足りないモンが…", 2, "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 1, 1, 0, "野戸まひる", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1033);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "ちょっと緊張しちゃって…", 2, "ちょ\nちょっと一杯飲んできます…！", 0, 1, 1, 1, 0, "綾瀬 ゆかり", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1034);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "知らない人とは話しちゃいけないので", 2, "これ以上お話しすることは…\nないです！", 0, 1, 1, 1, 0, "氷川 鏡華", 0, "氷川鏡華…です", 0, 0, 1036);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "……あ、アラーム。", 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 1, 1, 0, "柏崎 栞", 0, "柏崎…栞です。", 0, 0, 1038);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "私、一人も友達がいなくて……", 2, "野に咲く花が、\n唯一の話相手です。", 0, 1, 1, 1, 0, "双葉 碧", 0, "ふ、双葉碧です。", 0, 0, 1040);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, "そう思っています。", 0, 1, 1, 1, 0, "三角 千歌", 0, "三角千歌です。", 0, 0, 1042);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "あぁ？\nお前のそいつの仲間か？", 2, "う、疑ってすまなかったな…", 0, 1, 1, 1, 0, "安芸 真琴", 0, "安芸真琴だ。", 0, 0, 1043);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "生けとし生ける全ての者よ！", 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 1, 1, 0, "イリヤ・オーンスタイン", 0, "わらわこそは夜を総べる者！", 0, 0, 1044);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "ぐふふふふ……はっ！", 2, "ｌク、クウカに何かご用ですか!?", 0, 1, 1, 1, 0, "遠見 空花", 0, "そこで騎士は妖精を乱暴に……", 0, 0, 1045);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 1, 1, 0, "宮坂たまき", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1046);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "それでは早速クエストに…", 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 1, 1, 0, "大神 美冬", 0, "大神美冬よ！", 0, 0, 1048);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "クエストもバトルも\n掃除も洗濯も", 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 1, 1, 0, "星野静流", 0, "星野静流だよ！", 0, 0, 1049);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "見ての通りの\nセクシー美少女で", 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 1, 1, 0, "玉泉美咲", 0, "アタシは玉泉美咲。", 0, 0, 1050);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, "？？？？", 2, "？？？？", 0, 1, 1, 1, 0, "リマ", 0, "？？？", 0, 0, 1052);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1, 0, "モニカ・ヴァイスヴィント", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1053);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1, 0, "ペコリーヌ", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1058);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1, 0, "コッコロ", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1059);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1, 0, "キャル", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1060);
